// HasService applies the HasEdge predicate on the "service" edge.
func HasService() predicate.BronzeGCPRunRevision {
	return predicate.BronzeGCPRunRevision(func(s *sql.Selector) {
		step := sqlgraph.NewStep(
			sqlgraph.From(Table, FieldID),
			sqlgraph.Edge(sqlgraph.M2O, true, ServiceTable, ServiceColumn),
		)
		schemaConfig := internal.SchemaConfigFromContext(s.Context())
		step.To.Schema = schemaConfig.BronzeGCPRunService
		step.Edge.Schema = schemaConfig.BronzeGCPRunRevision
		sqlgraph.HasNeighbors(s, step)
	})
}

// HasServiceWith applies the HasEdge predicate on the "service" edge with a given conditions (other predicates).
func HasServiceWith(preds ...predicate.BronzeGCPRunService) predicate.BronzeGCPRunRevision {
	return predicate.BronzeGCPRunRevision(func(s *sql.Selector) {
		step := newServiceStep()
		schemaConfig := internal.SchemaConfigFromContext(s.Context())
		step.To.Schema = schemaConfig.BronzeGCPRunService
		step.Edge.Schema = schemaConfig.BronzeGCPRunRevision
		sqlgraph.HasNeighborsWith(s, step, func(s *sql.Selector) {
			for _, p := range preds {
				p(s)
			}
		})
	})
}

